    def __str__(self):
        return "StringifyOptions(heading_style={}, bullet={}, bullet_ordered={}, emphasis={}, strong={}, fence={}, rule={}, rule_repetition={}, rule_spaces={}, close_atx={}, list_item_indent={}, increment_list_marker={}, quote={}, fences={}, resource_link={})".format(self.heading_style, self.bullet, self.bullet_ordered, self.emphasis, self.strong, self.fence, self.rule, self.rule_repetition, self.rule_spaces, self.close_atx, self.list_item_indent, self.increment_list_marker, self.quote, self.fences, self.resource_link)
    def __eq__(self, other):
        if self.heading_style != other.heading_style:
            return False
        if self.bullet != other.bullet:
            return False
        if self.bullet_ordered != other.bullet_ordered:
            return False
        if self.emphasis != other.emphasis:
            return False
        if self.strong != other.strong:
            return False
        if self.fence != other.fence:
            return False
        if self.rule != other.rule:
            return False
        if self.rule_repetition != other.rule_repetition:
            return False
        if self.rule_spaces != other.rule_spaces:
            return False
        if self.close_atx != other.close_atx:
            return False
        if self.list_item_indent != other.list_item_indent:
            return False
        if self.increment_list_marker != other.increment_list_marker:
            return False
        if self.quote != other.quote:
            return False
        if self.fences != other.fences:
            return False
        if self.resource_link != other.resource_link:
            return False
        return True

